import axios from 'axios';

function fazGet(url){
    let request = new XMLHttpRequest()
    request.open("GET", url, false)
    request.send()
    return request.responseText
}

function api(){
    console.log(fazGet("http://127.0.0.1:8000/servicos/prestador/"))
}

api()



